webpackJsonp([0x81b8806e4260],{1112:function(e,A){e.exports={pathContext:{group:[{node:{id:"8bf38ac8-2240-4384-91d0-94a816db0e64",title:"Weeknotes 2",link:null,body:{value:'<p>(Photo by <a href="https://twitter.com/sugaroverflow">@sugaroverflow</a>)</p>\r\n<p>Posting these weeknotes late. Thankfully the only rule about this weeknotes thing is that there are no rules.</p>\r\n<p>MidCamp:</p>\r\n<p><a href="https://www.midcamp.org/">MidCamp</a> (the Midwest Drupal Camp) resulted in a week that was both all consuming and extremely gratifying.</p>\r\n<ul>\r\n<li>On Wednesday I led a <a href="https://www.midcamp.org/2019/training-proposal/google-analytics-and-google-tag-manager-101">Google Analytics and Google Tag Manager training session</a> along with the one and only <a href="https://www.linkedin.com/in/jonmeck/">Jon Meck</a>. It was my first time co-leading a training session at a Drupal event and even though I was one of the trainers I learned a ton.</li>\r\n<li>On Thursday I presented \'<a href="https://noti.st/brianperry/5uL8Bn/an-external-design-system-in-practice">An External Design System in Practice</a>\' for the first time. Got some great feedback and am excited to make a few tweaks before <a href="https://events.drupal.org/seattle2019/sessions/external-design-system-practice">presenting it again at DrupalCon</a>.</li>\r\n<li>On Friday I presented \'<a href="https://noti.st/brianperry/82jab2/an-introduction-to-static-site-generators-for-drupalists">An Introduction to Static Site Generators for Drupalists</a>.\' Enjoyed giving this talk as always and had time for a lengthy Q&A this time around.</li>\r\n<li>I used <a href="https://noti.st/">Notist for the first time to share content related to my talks. I like it quite a bit.</li>\r\n<li>Loved so many other talks, but especially <a href="https://www.midcamp.org/2019/topic-proposal/keynote-session-actions-speak-louder-code">Actions Speak Louder Than Code</a> (so happy that Fatima gave her first keynote at MidCamp,) <a href="https://www.midcamp.org/2019/topic-proposal/you-are-here-exploring-most-magical-cms-earth">You are Here: Exploring the Most Magical CMS on Earth</a> (worth it for one Drupal as Disney slide alone) and <a href="https://www.midcamp.org/2019/topic-proposal/bash-magic-no-its-not">Bash is Magic # No It\'s Not</a> (Dwayne was incredibly passionate about this topic which made it a joy to watch.)</li>\r\n<li>Had a productive contribution day getting to know more about the <a href="https://www.drupal.org/project/claro">Claro theme</a> and even got a patch updated. Heard great things about the efforts around Drupal 9 readiness as well.</li>\r\n<li>This was my first year involved as an organizer. I feel good about the execution of the camp and my role in it. And I\'m really just happy to work with such a great group to support an event that has meant a lot to me over the years.</li>\r\n</ul>\r\n<p>Everything Else:</p>\r\n<ul>\r\n<li>Went right from MidCamp to spend the rest of the weekend (plus Monday) with family in Wisconsin. A much needed break.</li>\r\n<li>Loved <a href="https://tv.avclub.com/a-familiar-bobs-burgers-cant-rule-out-bob-being-a-bread-1833196922">this Episode of Bob\'s Burgers</a></li>\r\n<li>Colin and I finished the <a href="https://www.pastemagazine.com/articles/2018/05/what-ive-learned-about-the-nintendo-labo-piano.html">Nintendo Labo Piano</a>, which was a personal triumph. Looking forward to the <a href="https://www.youtube.com/watch?v=uOjcbdAU5Gw">VR Kit</a> next.</li>\r\n<li>Started playing <a href="https://www.polygon.com/reviews/2019/3/13/18263824/baba-is-you-review-nintendo-switch-pc">Baba is You</a> after hearing good things. Find it occasionally maddening, but it is growing on me pretty quickly.</li>\r\n<li><a href="https://www.youtube.com/watch?v=rUmV-MorIKc">Tame Impala released a new single</a> and it is an absolute jam.</li>\r\n</ul>'},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.3434190620272315,src:"/static/6888b8aefb56a904c4981b7fb0d82388-5d57654046ed6df9deba6e4b96559a19-83585.png",srcSet:"/static/6888b8aefb56a904c4981b7fb0d82388-5d57654046ed6df9deba6e4b96559a19-cc46c.png 313w,\n/static/6888b8aefb56a904c4981b7fb0d82388-5d57654046ed6df9deba6e4b96559a19-21b66.png 625w,\n/static/6888b8aefb56a904c4981b7fb0d82388-5d57654046ed6df9deba6e4b96559a19-83585.png 1250w,\n/static/6888b8aefb56a904c4981b7fb0d82388-5d57654046ed6df9deba6e4b96559a19-dbe7c.png 1776w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/weeknotes-2/"},post_type:"post",created:1553569252}},{node:{id:"eb706094-badc-411d-ab2a-19c84b9c5fe5",title:"Weeknotes 1",link:null,body:{value:'<p>Stumbled across <a href="https://adactio.com/journal/14955">a collection of weeknote posts on Jeremy Keith’s website</a>.  Lately it has been difficult finding the time to post on my website (I\'m hoping to rebuild it soon,) so this seems like a great way to keep something going in the meantime.<p>\r\n<p>Work Stuff:</p>\r\n<ul>\r\n<li>Had meeting this week where we shared overviews of recent projects. Always inspiring and great to work with so many people doing cool things outside of the Drupal bubble that I sometimes live in.</li>\r\n<li>Been doing a lot of prep for <a href="http://midcamp.org">MidCamp</a>. I’ve been helping out with organizing the event, and I’m doing a <a href="https://www.midcamp.org/2019/training-proposal/google-analytics-and-google-tag-manager-101">training</a> along with <a href="https://www.midcamp.org/2019/topic-proposal/external-design-system-practice">two</a> <a href="https://www.midcamp.org/2019/topic-proposal/introduction-static-site-generators-drupalists-and-static-site-show-and-tell">sessions</a> (originally one, but I’m filing in for a cancellation.) It’s stressful, but I love the camp so I’m happy to endure the PowerPoint burnout. I’m excited for the talks, and it is been fun dusting off my old <a href="https://en.wikipedia.org/wiki/IBM_Unica_NetInsight">analytics hat</a> for the training.</li>\r\n<li>Project wise, I’ve been digging into <a href="https://docs.drupalcommerce.org/commerce2">Drupal Commerce</a> for the first time. Taking a bit to wrap my head around it, but I’m liking it thus far.</li>\r\n<li>Received some positive recognition at work for my efforts over the last year. Helps put some extra gas in the tank during what is going to be a busy couple of weeks.</li>\r\n<li>Got a nice shout of from Ryan at Hook 42 in their <a href="https://www.hook42.com/blog/florida-drupal-camp-sunglasses-alligators-community-and-connection">Florida Drupal Camp wrap up</a>.</li>\r\n<li>My office now has an Nintendo 64 with the original Smash Brothers. This is big news.</li>\r\n</ul>\r\n\r\n<p>Personal Stuff:</p>\r\n<ul>\r\n<li>Found out that Colin did really well on some advanced placement testing. He’ll destroy us all soon.</li>\r\n<li>I’m really itching for some warmer weather. Forced myself to run outside this weekend even though it was still a little cold - well worth it once I warmed up. Also really looking forward to getting back to outdoor barbecue.</li>\r\n</ul>\r\n\r\n<p>Stuff I\'m Into:</p>\r\n<ul>\r\n<li>Enjoying <a href="https://hollowknight.com/">Hollow Knight</a> on Switch along with <a href="https://www.nintendo.com/games/detail/tetris-99-switch">Tetris 99</a> (Switch) and <a href="https://www.tetriseffect.game/">Tetris Effect</a> (PS4). Who knew I’d be so into Tetris in 2019?</li>\r\n<li>To say I’m ‘into it’ is a stretch, but I’m still reeling from <a href="https://www.vulture.com/2019/03/comedians-remember-brody-stevens.html">Brody Steven’s passing</a>. Listened to a nice tribute on <a href="https://www.earwolf.com/episode/remembering-brody-stevens/">Who Charted</a>.</li>\r\n<li>Into the extremely thoughtful <a href="https://www.nytimes.com/column/still-processing-podcast">Still Processing Podcast</a> including <a href="https://www.nytimes.com/2019/03/07/podcasts/still-processing-mj-michael-jackson-leaving-neverland.html">their M.J. episode</a>.</li>\r\n<li>Beer: <a href="https://www.3floyds.com/beer/lord-rear-admiral/">3 Floyds Lord Rear Admiral</a>. An ESB with 3 Floyd\'s signature blown out flavor profile.</li>\r\n</ul>\r\n<p>I made it through my first weeknote!</p>\r\n\r\n'},relationships:{image:null},fields:{slug:"/post/weeknotes-1/"},post_type:"post",created:1552859717}},{node:{id:"2be0a19b-18e4-4ca3-9f85-c1c12e2ec81f",title:"Intentional Home Improvements",link:null,body:{value:"<p>New Year's resolution time!</p>\r\n<p>Things felt a little different heading into 2019. I usually have a pretty good handle on what I want to accomplish in the upcoming year, along with a formal resolution. But this year, nothing. Initially that seemed terrifying, but the more I think about it, that openness and lack of expectation is an exciting resolution in and of itself.</p>\r\n<p>Standing in my now <em>mostly</em> finished kitchen I also came up with another late breaking resolution. 2019 is going to be the year of intentional home improvements. Rather than letting a flood force me into it, I'm going to try to proactively decorate, improve and declutter. It is pleasantly (mostly) non-technical, and I can tackle it in tiny chunks throughout the year.</p>\r\n<p>Wishing everyone a happy and productive 2019 full of dry kitchens.</p> "},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3325545171339563,src:"/static/7a2b1cec12f214827ef01ed3e15f2d23-f78ecd9f9b85b124e32b1a1474c72002-42807.jpg",srcSet:"/static/7a2b1cec12f214827ef01ed3e15f2d23-f78ecd9f9b85b124e32b1a1474c72002-960f9.jpg 313w,\n/static/7a2b1cec12f214827ef01ed3e15f2d23-f78ecd9f9b85b124e32b1a1474c72002-c36f2.jpg 625w,\n/static/7a2b1cec12f214827ef01ed3e15f2d23-f78ecd9f9b85b124e32b1a1474c72002-42807.jpg 1250w,\n/static/7a2b1cec12f214827ef01ed3e15f2d23-f78ecd9f9b85b124e32b1a1474c72002-dbc5e.jpg 1875w,\n/static/7a2b1cec12f214827ef01ed3e15f2d23-f78ecd9f9b85b124e32b1a1474c72002-6e234.jpg 2500w,\n/static/7a2b1cec12f214827ef01ed3e15f2d23-f78ecd9f9b85b124e32b1a1474c72002-98489.jpg 3422w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/intentional-home-improvements/"},post_type:"post",created:1546524528}},{node:{id:"01372c17-fb3c-4003-9377-0d94ff8e1859",title:"Happy Holidays",link:null,body:{value:"<p>I'm enjoying my traditional holiday illness this year. Without fail, once reach holiday break my defenses shut down and I catch a cold (or worse.) I'm thinking next year I'm going to take the week before Christmas off and just live in one of those plastic bubbles.</p>\r\n<p>Wishing everyone a happy and healthy holiday season.</p>"},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.7226378498198948,src:"/static/b052a144cb5a7e30624736be2995ff7e-12d75de6486a6218175a57fba5f8e6d4-42807.jpg",srcSet:"/static/b052a144cb5a7e30624736be2995ff7e-12d75de6486a6218175a57fba5f8e6d4-960f9.jpg 313w,\n/static/b052a144cb5a7e30624736be2995ff7e-12d75de6486a6218175a57fba5f8e6d4-c36f2.jpg 625w,\n/static/b052a144cb5a7e30624736be2995ff7e-12d75de6486a6218175a57fba5f8e6d4-42807.jpg 1250w,\n/static/b052a144cb5a7e30624736be2995ff7e-12d75de6486a6218175a57fba5f8e6d4-dbc5e.jpg 1875w,\n/static/b052a144cb5a7e30624736be2995ff7e-12d75de6486a6218175a57fba5f8e6d4-6e234.jpg 2500w,\n/static/b052a144cb5a7e30624736be2995ff7e-12d75de6486a6218175a57fba5f8e6d4-19574.jpg 2608w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/happy-holidays/"},post_type:"post",created:1545665583}},{node:{id:"3bfb027d-d913-4bad-830b-bde82f4bc1ea",title:"Flip Grip Mini Review",link:null,body:{value:'<p>\'Tis the season for all of the random Nintendo Switch related Kickstarter projects I backed throughout the year to show up in advance of the holidays.</p>\r\n<p>The <a href="https://www.kickstarter.com/projects/fangamer/flip-grip">Flip Grip</a> is a simple, but extremely well designed piece of plastic that allows you to play Switch in vertical mode. Didn\'t know that vertical mode was a thing? A small subset of often retro games support it. To try out the grip I picked up <a href="https://www.nintendo.com/games/detail/arcade-archives-donkey-kong-switch">Arcade Archives: Donkey Kong</a>, <a href="https://www.nintendo.com/games/detail/namco-museum-switch">Namco Museum</a>, and <a href="https://www.nintendo.com/games/detail/pinball-fx3-switch">Pinball FX3</a>. All told, I spent much more on games than the $12 that the grip costs.</p>\r\n<p>Overall, it works extremely well for the games that support vertical mode. It isn\'t something that I\'ll use that often, but I love having yet another configuration of this versatile device. Fingers crossed that a version of Ms. Pac-Man that supports vertical mode is released at some point.</p>  '},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.0769230769230769,src:"/static/44f040f8156059abc476919c742536e9-ad5332e1f790f5c9da3106e56e871d1d-42807.jpg",srcSet:"/static/44f040f8156059abc476919c742536e9-ad5332e1f790f5c9da3106e56e871d1d-960f9.jpg 313w,\n/static/44f040f8156059abc476919c742536e9-ad5332e1f790f5c9da3106e56e871d1d-c36f2.jpg 625w,\n/static/44f040f8156059abc476919c742536e9-ad5332e1f790f5c9da3106e56e871d1d-42807.jpg 1250w,\n/static/44f040f8156059abc476919c742536e9-ad5332e1f790f5c9da3106e56e871d1d-dbc5e.jpg 1875w,\n/static/44f040f8156059abc476919c742536e9-ad5332e1f790f5c9da3106e56e871d1d-6e234.jpg 2500w,\n/static/44f040f8156059abc476919c742536e9-ad5332e1f790f5c9da3106e56e871d1d-a7d90.jpg 3024w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/flip-grip-mini-review/"},post_type:"post",created:1544108145}}],pathPrefix:"",first:!0,last:!1,index:1,pageCount:12,additionalContext:{}}}}});
